import React from 'react';
import '../Styles/Blog.css';

const Blog = () => {
  return (
    <section>
        <div className="container">
            <div className="blog_top-content">
                <h6 className="subtitle">
                    <h2>
                        Let's have a look from our
                        <span className='highlight' >recent blog</span>
                    </h2>
                </h6>
            </div>
        </div>
    </section>
  );
};

export default Blog;
